#include "http_parser.h"
#include <stdint.h>
#include <string.h>

int LLVMFuzzerTestOneInput(const uint8_t* data, size_t size) {
  if (size == 0) {
    return 0;
  }
  enum http_errno err;
  memcpy(&err, data, sizeof(enum http_errno));
  if (err < 0 || err >= _HTTP_ERRNO_H) {
    return 0;
  }
  const char* name = http_errno_name(err);
  return 0;
}
